import React, { Component } from 'react'
import './Navbar.css'
export default class Navbar extends Component {
    render() {
        return (
            <div>
              <nav class="navbar navbar-light bg-light">
  <span class="navbar-brand mb-0 h1">Navbar</span>
</nav>
            </div>
        )
    }
}
